.
▪ First image of Monza?
“Easy, I think about last year's victory. I will be always a special place for me. The image I think about is the podium, I saw the team and my brothers and on the other side all the Ferrari fans. I was looking for my mother in the stands, but there were to many people.” 🇮🇹
.
▪ What makes you positive?
“I am optimistic by nature, even though we are in a negative period. I believe in the people of the team, we can recover. Up until last year we were competitive, we need to be strong in these difficult moments.” ♥️
.
▪ We heard you angry at Spa: what do you think?
“It was a gut reaction, it was mistranslated. It wasn't addressed to anyone, it is a bad word in French referring to the situation. It wasn't polite, but it was a natural reaction and without knowing that I had the radio on. Today I laugh seeing it.” 🗣
.
▪ Seeing the fact that you have a long-term contract with Ferrari do you feel in a cage or are you calm about the future?
“Being in a cage with Ferrari? I would like to be a cage with Ferrari until the end of my life. It is an honor to drive a Ferrari even in difficult moments.” 😊
.
.
